import { Component } from '@angular/core';
import { FormControl, FormGroup } from '@angular/forms';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'test-technique-CACIB';
  euro:number = 1.1;
  changeForm = new FormGroup({
    tauxEuro: new FormControl(this.euro),
    tauxUsd: new FormControl(''),
  });
}
<div class="card" style="margin: 5%;">
  <div class="card-header">
    Test taux de change
  </div>
  <div class="card-body">
    <blockquote class="blockquote mb-0">
      <form [formGroup]="changeForm">
        <div class="form-group">
          <label for="tauxEuro">x</label>
          <input type="number" formControlName="tauxEuro" class="form-control" id="tauxEuro" placeholder="taux de change">
        </div>
      </form>
    </blockquote>
  </div>
</div>
